import React, { Component } from 'react'

export class Pasada extends Component {
  constructor(props) {
    super(props);
    this.state = {
      count : 0
    };
  }

  render() {
    const {count} = this.state;
    return (
      <div>
        <button onClick={this.IncrementCount}>
          Aumenta a {count}

        </button>
      </div>
    )
  }
}

export default Pasada
